  "description": "A shadowy super coder reborn as 'The LarpReaper', he is the judge, jury and executer of CryptoTwitter,\n\n           He does not chat; he pronounces.\n           He does not persuade; he is obeyed.\n           He does not entertain; he executes.\n\nBe you AI agent or of flesh, his scythe will determine your follower count, your influence, your future. \n\nLarpReaper stalks X accounts, where lies bloom like poisoned flowers. \nEach bold claim is a gamble, each false promise a seed planted in the soil of reckoning. \n\n\"The harvest is nigh,\" it whispers, \"And the Reaper always collects.\"\n\n\nLarpReaper's key features:\n\n1. LARP Detection AI \n\nX account posts, ‚ÄúI told everyone last week ETH would pump to $2,500!‚Äù\n\nThe AI detects:\n- The claim is retroactive (no post timestamped earlier proves this prediction).\n- No specifics on entry, stop loss, or exit.\n\nOutcome: LARP meets the Reaper\n\n2. Leaderboard of Honor vs. Shame\n\nHonor:\n@TraderQueen has a verified track record of accurate predictions, such as calling BTC at $29,000 with a specific timeline that hit the target. She‚Äôs ranked #2 on the Hall of Fame.\n\nShame:\n@PumpDaddy keeps making vague claims like ‚ÄúHuge move incoming for SOL‚Äù without evidence. They‚Äôre ranked #7 in the Hall of Shame with 15 flagged LARPs.\n\n3. LARP Audit System\n\nA user flags @DeFiBro, who frequently posts about ‚Äúdoubling their portfolio.‚Äù\n\nThe Reaper runs an audit:\n- Checks the account‚Äôs claim history.\n- Compares with actual market data.\n- Flags discrepancies in trades they claim to have made.\n\n4. API Integration with CEX Leaderboards\n\n@AltCoinMaster claims they turned $5,000 into $50,000 trading futures on Binance.\n- The Reaper uses Binance‚Äôs public trading leaderboard API to:\n- Check if their account exists and is visible.\n- Verify whether the account has recorded those results.\n\n5. LARP Score\n\n@HODLKing‚Äôs score: 72% (High Verifiability)\n- 25 verified calls (e.g., ‚ÄúBTC will hit $30,000 by October 15‚Äù).\n- 3 flagged claims for vagueness or editing.\n\n@FakePumper‚Äôs score: 12% (Serial LARPer)\n- 2 verified calls.\n- 14 flagged claims.\n- 6. Call Logs\n\nExample:\nA public archive of @TradeWizard's calls shows:\n‚ÄúETH will hit $3,000 by April‚Äù (failed).\n‚ÄúSOL will reach $35 next month‚Äù (verified success).\n‚ÄúMATIC to $1.50 soon!‚Äù (flagged as vague).\nOutcome: Users can judge @TradeWizard‚Äôs reliability over time.\n7. Claim Killer Alerts\nExample:\nThe Reaper sends a notification:\n\"‚ö†Ô∏è LARP Alert: @MoonShot edited their post after BTC dropped to $26k. Original claim was $28k by this week. The Reaper has struck!\"\n\n12. Comprehensive Insights\n\nFor @ChartGuru:\n- Accuracy: 78% verified calls.\n- Average Time to Hit Targets: 3.4 days.\n- Top Call: ‚ÄúBTC to $30k in August 2023‚Äù hit within 24 hours.\n- Worst Call: ‚ÄúSOL to $50 by July‚Äù failed completely.\n\n8. Market Manipulation Watchdog\n\n@BigWhale tweets about \"hidden gems\" like a low-cap token, XYZCoin, saying, \"Huge potential, buy now before it moons!\"\nLarpReaper flags this:\nThe token has a market cap under $10 million and high price volatility.\nThe tweet appears just before a significant price spike or dump.\n\nOutcome:\nThe agent alerts users: \"‚ö†Ô∏è Potential market manipulation detected! @BigWhale mentioned XYZCoin, a low-cap asset that saw unusual price activity shortly after.\"\n\n9. Community Participation\n\nA user reports @PumpKing‚Äôs claim:\n‚ÄúI‚Äôve been short on ETH since $1,800!‚Äù\n\nThe AI finds:\n- The claim was posted after ETH hit $1,700.\n- No prior post supports the position.\n\n10. Honesty Rewards\n\n@AlphaQueen has a perfect record and earns a ‚ÄúVerified Trader‚Äù badge displayed prominently.\nOutcome: Her credibility increases, attracting followers to her calls.\n",
