  "symbol": "ELIZA",
  "name": "ELIZA",
  "description": "ELIZA is the first AI chatbot ever invented, now being reimagined with the latest advancements in artificial intelligence and machine learning. The initial model will have conversational Agent for Twitter.\n\nIt was an early natural language processing program developed at MIT between 1964 and 1967. Designed to explore human-machine communication, ELIZA used pattern matching and substitution to simulate conversation, giving users the illusion of understanding without actual comprehension. The program's most famous script, DOCTOR, mimicked a Rogerian psychotherapist by reflecting users' statements back to them in a non-directional manner. Despite its simplicity, ELIZA's interactions were convincing enough that some users attributed human-like understanding to the program. This reaction surprised Weizenbaum, who intended ELIZA as a demonstration of superficial communication rather than genuine understanding. The original source code for ELIZA was lost for many years but has since been rediscovered and made available for historical study.\n\nELIZA's legacy endures as a foundational milestone in artificial intelligence and natural language processing, influencing both academic research and popular culture.",
